import React from "react";
import ImageDialog from "../dialog/ImageDialog";
import { Typography, Box, Grid, Card, CardMedia } from "@mui/material";
import SampleImage1 from "../dawnload/sampleImage_cat.jpg";
import SampleImage2 from "../dawnload/sampleImage_dog.jpg";
const bookList = [
  {
    id: 1,
    image: SampleImage1,
    sizePer: 30,
  },
  {
    id: 2,
    image: SampleImage2,
    sizePer: 30,
  },
];
function Schedule() {
  return (
    <div className="Schedule" id="item_4" style={{ height: "100vh" }}>
      <Typography variant="h4" style={{ textAlign: "center" }}>
        スケジュール
      </Typography>
      <Grid container justifyContent="center" alignItems="center">
        {bookList.map((item, index) => (
          <Grid key={index}>
            <ImageDialog bookParam={item} />
          </Grid>
        ))}
      </Grid>
    </div>
  );
}

export default Schedule;
